Once OpenAsar is installed (see Installing OpenAsar ), if you go to Settings in the Discord app, you should see a new section in the sidebar under "App Settings" called "OpenAsar". Clicking this will open the OpenAsar settings window. From this window, you can turn off a lot (but most likely not all) of Discord's spyware by completely blocking the /api/science Discord API endpoint, disable showing others when you're typing in Discord, and apply custom CSS from the "Theming" tab. OpenAsar settings page One of the things that annoys me the most about Discord is how aggressively they push Discord Nitro subscriptions on you everywhere throughout the app, and how arbitrary the set of features that are put behind the Nitro paywall is. Sorry, Discord, but I will never, ever pay money for Discord Nitro, ever. I would try convincing my friends to switch to Matrix before paying for Nitro. With OpenAsar, I can use the "Theming" tab to inject custom CSS and remove a lot of the Discord Nitro ads from the Discord app. /* Hide all things Discord Nitro */
/* "Add Super Reaction" button */
div[aria-label="Add Super Reaction"],
/* Super Reactions others have added */
div[class*="reactionInner"][aria-label*="super"],
/* "Nitro" section in sidebar of settings page */
div[class*="premiumTab"],
/* The huge Nitro ads on the profile customization page */
div[class*="premiumFeatureBorder"],
/* Discord's Birthday stuff on the profile customization page */
div[class*="birthdayFeatureBorder"],
/* The "boost" status on Discord server sidebars */
div[aria-label*="Buy Boosts to help unlock"],
/* The "Nitro" item in the direct messages list */
ul[aria-label="Direct Messages"] a[href="/store"],
/* The "Discord's Birthday" item in the direct messages list */
ul[aria-label="Direct Messages"] a[href="/activities"]
/* The "Start an Activity" button */
button[aria-label="Start an Activity"] { display: none;
}
